import { useNavigate } from 'react-router-dom';
import Signup from './Signup';

function Userpage({ email, age }) {
  const navigate = useNavigate();

  const handleSignupSuccess = (email: string, age: number) => {
    console.log(`User with email ${email} and age ${age} signed up successfully`);
    // Do something with the email and age values
  }

  const handleLogout = () => {
    // Implement logout logic here, e.g. delete the token and redirect to login page
    navigate('/login')
  };

  const handleMyList = () => {
    navigate('/login')
  };

  return (
    <div>
      <h1>Welcome</h1>
      <p>Email: {email}</p>
      <p>Age: {age}</p>
      <button onClick={handleLogout}>Logout</button>
      <button onClick={handleMyList}>My List</button>
    </div>
  );
}

export default Userpage;
